import tkinter as tk, pygame, base64, random
from io import BytesIO


pygame.mixer.init()

sound1 = ""

sound2 = ""

sound3 = ""

sound4 = ""

class Notice:
    def __init__(self, root: tk.Toplevel, master: tk.Frame, color: str='white', title: str='Notice'):
        self.root = root
        self.master = master
        self.color = color
        
        self.frame = tk.Frame(self.master)

        self.title = tk.Label(self.frame, text=title, font=("Arial", 16), bg=self.color)
        self.title.pack(side="top", fill="x")

        # 创建一个包含滚动条的Canvas
        self.canvas = tk.Canvas(self.frame, bg=self.color) # 移除了宽度和高度的直接设定
        self.canvas.pack(side="right", fill="both", expand=True)
        self.scrollbar = tk.Scrollbar(self.frame, orient="vertical", command=self.canvas.yview, bg=color) # type: ignore
        self.scrollable_frame = tk.Frame(self.canvas, bg=color)
        self.scrollable_frame.pack(fill=tk.BOTH)

        # 绑定滚动条到Canvas
        self.canvas.configure(yscrollcommand=self.scrollbar.set)
        # self.canvas.pack(side="right", fill="both", expand=True) # 使用pack()之前设置fill和expand
        self.scrollbar.pack(side="right", fill="y") # 保持在Canvas pack之后

        # 在Canvas内部创建窗口
        self.canvas.create_window((0, 0), window=self.scrollable_frame, anchor='nw')

        # 配置Canvas的滚动行为
        self.scrollable_frame.bind("<Configure>", lambda e: self.canvas.configure(scrollregion=self.canvas.bbox("all")))

    def EmitNotice(self, title: str, message: str):
        # self.root.title(title)
        f = tk.Frame(self.scrollable_frame, bg=self.color, highlightbackground="grey", highlightthickness=2)
        f.pack(fill=tk.X)

        titleLbl = tk.Label(f, text=title, bg=self.color)
        # titleLbl.pack(side=tk.LEFT, padx=10, pady=10)
        titleLbl.grid(row=0, column=0)

        messageLbl = tk.Label(f, text=message, bg=self.color)
        # messageLbl.pack(side=tk.LEFT, padx=10, pady=10)
        messageLbl.grid(row=1, column=0)

        # 解码并播放音乐
        audio_data = base64.b64decode(random.choice([sound1, sound2]))
        audio_stream = BytesIO(audio_data)
        pygame.mixer.music.load(audio_stream)
        pygame.mixer.music.play()
    
    def EmitErrorNotice(self, title: str, message: str):
        # self.root.title(title)
        f = tk.Frame(self.scrollable_frame, bg="red", highlightbackground="grey", highlightthickness=2)
        f.pack(fill=tk.X)

        titleLbl = tk.Label(f, text=title, bg="red")
        # titleLbl.pack(side=tk.LEFT, padx=10, pady=10)
        titleLbl.grid(row=0, column=0)

        messageLbl = tk.Label(f, text=message, bg="red")
        # messageLbl.pack(side=tk.LEFT, padx=10, pady=10)
        messageLbl.grid(row=1, column=0)

        # 解码并播放音乐
        audio_data = base64.b64decode(random.choice([sound3, sound4]))
        audio_stream = BytesIO(audio_data)
        pygame.mixer.music.load(audio_stream)
        pygame.mixer.music.play()
    
    def pack(self):
        self.frame.pack(fill=tk.BOTH, expand=True)

if __name__ == '__main__':
    import asyncio
    root = tk.Tk()
    root.geometry("400x400")
    root.title("Notice")
    root.configure(bg='lightblue')
    _ = tk.Frame(root, bg='lightblue')
    _.pack(fill=tk.BOTH, expand=True)
    notice = Notice(root, _, color='lightblue') # type: ignore
    notice.pack()
    notice.EmitNotice("Hello", "This is a notice.")
    ones = False
    while True:
        if root is None: break # type: ignore
        root.update()
        if not ones:
            async def __():
                await asyncio.sleep(2)
                notice.EmitErrorNotice("Error", "This is an error notice.")
            asyncio.run(__())
            ones = True
